Existing typings do not work for decorator usage of DnD higher order component wrappers.
For example, the following would fail:

``` @DragDropContext(HTML5Backend)
class ComponentFail extends React.Component<any, any> {
  failYourCompilation() {
    // any property or method that is not part of React.Component causes this failure
  }

  render(){
    return ( <div> Hello </div> );
  }
}
```

with an error like:

```
error TS1238: Unable to resolve signature of class decorator when called as an expression.                                                                                                                                         
  Type 'ContextComponentClass<ComponentFail>' is not assignable to type 'typeof ComponentFail'.                                                                                                                                                                                      
    Type 'ContextComponent<{}, any>' is not assignable to type 'ComponentFail'.                                                                                                                                                                                           
      Property 'failYourCompilation' is missing in type 'ContextComponent<{}, any>'.
```

The most substantive change here is that the wrapper functions now return an intersection of the type of the component being wrapped and the extra bits added by the wrappers (ie. `DndComponent`'s `getDecoratedComponentInstance()` method), rather than a vanilla React component that supports those extra bits.

I've added a separate decorator tests file. It is a copy of the original tests, but applies all DnD wrappers via decorators instead of function calls. It only passes tests if `--experimentalDecorators` is enabled in `tsc`. I'm not sure if that should be included in this PR because DefinitelyTyped is a mysterious system, but it's included for now for review :)

Note that stateless components cannot be decorated this way (by virtue of how decorators work), but can still be wrapped using non-decorator syntax.

Cheers!

