The original serializer definition is : 

``` typescript
interface Serializers {
        [key:string]: (input:any) => string;
}
```

However, in the source code, Req Serializers, Err serializers and REs serializer all return a JSON Object.  See `res`: 

``` javascript
// Serialize an HTTP response.
Logger.stdSerializers.res = function res(res) {
    if (!res || !res.statusCode)
        return res;
    return {
        statusCode: res.statusCode,
        header: res._header
    }
};
```

So I just changed this, and also added a definition for these 3 default serializers.
- I also added a definition for the 3 defaults serializers (err, res and req)

With this, it is possible to define specific interfaces that match the actual implementation

```
interface IChatMessage {
   UserName: string;
   Message: string;
}

interface IContosoChatHub extends SignalR.Hub.Proxy {
   client: {
      addMessageToPage : (message: IChatMessage) => void;
   },
   server: {
      newContosoChatMessage: (message: IChatMessage) => JQueryPromise<void>;
   },
   state: {
      someState: string;
   }
}

var hub = <IContosoChatHub>$.connection['contosoChatHub'];
var withoutGeneratedProxy = $.hubConnection().createHubProxy<IContosoChatHub>("contosoChatHub");

hub.state.someState = "hello";
hub.client.addMessageToPage({ UserName: "123", Message: "msg" });
hub.server.newContosoChatMessage({ UserName: "123", Message: "msg" }).done(() => console.log("Success"));
```

